# globally-accessible objects:
DBSession = connection


# Define startup & shutdown logic using lifespan
@asynccontextmanager
async def lifespan(app: FastAPI):
    # STARTUP
    logging.basicConfig(level=logging.INFO)
    logging.info('     API Startup begins')

    # Database
    logging.info('     DB initialization')
    DBSession = initSession()
    
    logging.info('     API Startup completed.')

    yield
    
    # SHUTDOWN
    ##


# Initialise FastAPI instance
app = FastAPI(lifespan=lifespan)


# HTML GET METHOD
#   GET form
@app.get("/", response_class=HTMLResponse)
async def root():
    m  = showHead()
    m += showForm('','v')
    m += showFoot()
    return HTMLResponse(content=m, status_code=200)




# HTML FORM POST METHOD
#   Recommendation from search
@app.post("/recommend", response_class=HTMLResponse)
async def login(text: Annotated[str, Form()], opts: Annotated[str, Form()]):

    # return results
    m  = showHead()
    m += showForm(text,opts)

    # Vector Search component
    #   if Vector included in options
    top_products = []
    if opts == "v" or opts == "vl":
        top_products = vectorSearch(text)
        ###top_products = [{"product_id": 1,"product_name": "hello","description": "Hello"}]
    
        m += "<h2>Vector Search Results</h2>"
        m += "<table cellspacing='0' cellpadding='5' border='1'>"
        
        """
        m += "<tr><td><b>PID</b></td><td><b>Product Name</b></td><td><b>Product Description</td><td><b>Consumer Description</b></td></tr>"    
        for row in top_products:
            m += (f"<tr><td>{row['product_id']}</td><td>{row['product_name']}</td><td>{row['description']}</td><td>{row['consumer_description']}</td></tr>")
        """
        m += "<tr><td><b>PID</b></td><td><b>Product Name</b></td><td><b>Product Description</td></tr>"    
        for row in top_products:
            m += (f"<tr><td>{row['product_id']}</td><td>{row['product_name']}</td><td>{row['description']}</td></tr>")
        
        m += "</table>"

    # LLM component
    #   if LLM included in options
    if opts == "l" or opts == "vl":
        m += "<p>&nbsp;<h2>LLM Assisted Output</h2>"
        m += llmAssist(text,top_products)


    m += showFoot()

    return HTMLResponse(content=m, status_code=200)



#
# function to execute vector search
#
def vectorSearch(text):
    # load settings and keys
    settings = Settings()

    # define openai Key
    openai.api_key = settings.OPENAI_API_KEY

    # define the embedding model
    model_id = "text-embedding-ada-002"

    # Generate embedding
    output = openai.Embedding.create(input=text, model=model_id)['data'][0]['embedding']

    # build vector search query
    # consumer_description_embedding
    # openai_description_embedding
    query = SimpleStatement(
        f"""
        SELECT * 
        FROM products_table
        ORDER BY openai_description_embedding ANN OF {output} LIMIT 5;
        """
        )

    # execute query
    results = DBSession.execute(query)
    top_products = results._current_rows
    return top_products



#
# function to invoke LLM assistance
#
def llmAssist(text,top_products):
    # load settings and keys
    settings = Settings()

    # define openai Key
    openai.api_key = settings.OPENAI_API_KEY
        
    message_objects = []

    # With the role as 'system',  we tell the model how we want it to behave and tell it how its personality and type of response should be.
    message_objects.append({"role":"system",
                            "content":"You're a chatbot helping customers with questions and helping them with product recommendations"})

    # With the role as 'user',  pass the question from user.
    message_objects.append({"role":"user",
                            "content": text})

    message_objects.append({"role":"user",
                            "content": "Please give me a detailed explanation of your recommendations"})
    message_objects.append({"role":"user",
                            "content": "Please include the price"})

    message_objects.append({"role":"user",
                            "content": "Please be friendly and talk to me like a person, don't just give me a list of recommendations"})

    #message_objects.append({"role":"user",
    #                        "content":"Your recommendation must include one from the recommended products I will provide"})

    # With the role as 'assistant',  load the results from Astra with Vector Search.  That helps the model to provide answer to the question asked by user.
    message_objects.append({"role": "assistant",
                            "content": "I found these 5 products I would recommend"})

    products_list = []

    for row in top_products:
        brand_dict = {'role': "assistant", "content": f"{row['description']}"}
        products_list.append(brand_dict)

    message_objects.extend(products_list)
    message_objects.append({"role": "assistant", "content":"Here's my summarized recommendation of products, and why it would suit you:"})

    completion = openai.ChatCompletion.create(
        model="gpt-3.5-turbo",
        messages=message_objects
    )

    m = '<p>'.join(completion.choices[0].message['content'].splitlines())
    m += '&nbsp;<p>&nbsp;<div class="prompt"><h3>Generated Prompt</h3>'
    for line in message_objects:
        m += f"<p>{line}"
    m += '</div>'

    return m
    #return (completion.choices[0].message['content'])
    




